begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(112546899918939630404)
,p_plugin_type=>'REGION TYPE'
,p_name=>'APEX.FANCYTREE.SELECT'
,p_display_name=>'APEX FancyTree Select'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('REGION TYPE','APEX.FANCYTREE.SELECT'),'')
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_AJAX (',
'    P_REGION   IN APEX_PLUGIN.T_REGION,',
'    P_PLUGIN   IN APEX_PLUGIN.T_PLUGIN',
') RETURN APEX_PLUGIN.T_REGION_AJAX_RESULT',
'    IS',
'    VR_RESULT   APEX_PLUGIN.T_REGION_AJAX_RESULT;',
'BEGIN',
'    APEX_UTIL.JSON_FROM_SQL(SQLQ => P_REGION.SOURCE);',
'    RETURN VR_RESULT;',
'END;',
'',
'FUNCTION F_RENDER (',
'    P_REGION                IN APEX_PLUGIN.T_REGION,',
'    P_PLUGIN                IN APEX_PLUGIN.T_PLUGIN,',
'    P_IS_PRINTER_FRIENDLY   IN BOOLEAN',
') RETURN APEX_PLUGIN.T_REGION_RENDER_RESULT IS',
'    VR_RESULT            APEX_PLUGIN.T_REGION_RENDER_RESULT;',
'    VR_CONF_JSON         APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_01%TYPE := P_REGION.ATTRIBUTE_01;',
'    VR_SRC_ITEM          APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_02%TYPE := P_REGION.ATTRIBUTE_02;',
'    VR_ERR_MSG           APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_03%TYPE := P_REGION.ATTRIBUTE_03;',
'    VR_ACTIVE_ID_ITEM    APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_04%TYPE := P_REGION.ATTRIBUTE_04;',
'    VR_USE_LOCALSTORAGE  APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_05%TYPE := P_REGION.ATTRIBUTE_05;',
'    VR_GET_CACHE_VERSION APEX_APPLICATION_PAGE_REGIONS.ATTRIBUTE_06%TYPE := P_REGION.ATTRIBUTE_06;',
'    VR_ITEMS2SUBMIT      APEX_APPLICATION_PAGE_REGIONS.AJAX_ITEMS_TO_SUBMIT%TYPE := APEX_PLUGIN_UTIL.PAGE_ITEM_NAMES_TO_JQUERY(P_REGION.AJAX_ITEMS_TO_SUBMIT);',
'    VR_REGION_ID         VARCHAR2(200 CHAR) := ''ft-'' || P_REGION.STATIC_ID;',
'    VR_IS_CACHE_VALID    VARCHAR2(4000 CHAR) := ''V1'';',
'BEGIN',
'    APEX_CSS.ADD_FILE(',
'        P_NAME        => ''fancytree.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''fancytreecsssrc''',
'    );',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''fancytree.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''fancytreejssrc''',
'    );',
'',
'    SYS.HTP.P( ''<div id="''|| APEX_PLUGIN_UTIL.ESCAPE( VR_REGION_ID, TRUE ) || ''" class="fancy-tree-region"></div>'' );',
'    ',
'    IF VR_USE_LOCALSTORAGE = ''Y'' AND VR_GET_CACHE_VERSION IS NOT NULL THEN',
'        VR_IS_CACHE_VALID := APEX_PLUGIN_UTIL.GET_PLSQL_FUNCTION_RESULT(VR_GET_CACHE_VERSION);',
'    END IF;',
'',
'    APEX_JAVASCRIPT.ADD_ONLOAD_CODE( ''fancyTree.initTree(''',
'     || APEX_JAVASCRIPT.ADD_VALUE( ''#'' || VR_REGION_ID, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( APEX_PLUGIN.GET_AJAX_IDENTIFIER, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.NO_DATA_FOUND_MESSAGE, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_ERR_MSG, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_CONF_JSON, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_ITEMS2SUBMIT, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( P_REGION.ESCAPE_OUTPUT, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_SRC_ITEM, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_ACTIVE_ID_ITEM, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_USE_LOCALSTORAGE, TRUE )',
'     || APEX_JAVASCRIPT.ADD_VALUE( VR_IS_CACHE_VALID, FALSE )',
'     || '');'' );',
'',
'    RETURN VR_RESULT;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_ajax_function=>'F_AJAX'
,p_standard_attributes=>'SOURCE_SQL:AJAX_ITEMS_TO_SUBMIT:NO_DATA_FOUND_MESSAGE:ESCAPE_OUTPUT'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'This Plug-in is used to draw a FancyTree with select option. Selected item ids could be stored into apex items.',
'',
'To trigger expand or collapse just fire e.g. on button click a dynamic action with JavaScriptCode:',
'',
'$("#static-tree-region-id-of-the-tree-region").trigger("expandAll");',
'',
'$("#static-tree-region-id-of-the-tree-region").trigger("expandAll");'))
,p_version_identifier=>'2.1.2'
,p_about_url=>'https://github.com/RonnyWeiss/Apex-Fancy-Tree-Select'
,p_files_version=>3152
);
