 p_id=>wwv_flow_api.id(8846945686174705)
,p_plug_name=>'Results'
,p_region_name=>'results_rn'
,p_parent_plug_id=>wwv_flow_api.id(8846838691174704)
,p_region_template_options=>'#DEFAULT#:t-Region--noPadding:js-showMaximizeButton:t-Region--scrollBody'
,p_plug_template=>wwv_flow_api.id(38667579460790978250)
,p_plug_display_sequence=>30
,p_include_in_reg_disp_sel_yn=>'Y'
,p_plug_display_point=>'BODY'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'WITH',
'apex_params AS (',
'    SELECT  :P6_TREE_PAT_KEY AS PAT_KEY,',
'            :P6_TREE_LINK_KEY AS TREE_LINK_KEY',
'    FROM    dual            ',
'),',
'request_tests AS (',
'    SELECT ',
'            /*+ materialize */',
'            req.req_key,',
'            req.req_relev_date,',
'            rqt.rqt_key,',
'            dcp.dcp_key,',
'            dcp.dcp_name,',
'            dpt.dpt_key,',
'            dpt.dpt_name,',
'            parent_rqt_key,',
'            rqt.rqt_rank,',
'            rqt.td_key,',
'            rqt.rqt_desc,',
'            rqt.abn_key,',
'            rqt.ref_key',
'    FROM    ilms5.request@apex_link REQ,',
'            ilms5.request_test@apex_link rqt,        ',
'            Department@apex_link dpt,',
'            DEPT_TYPE@apex_link dptt,',
'            DISCIPLINE@apex_link dcp,',
'            apex_params params',
'    WHERE   req.req_key = rqt.req_key',
'    AND     rqt.dpt_key = dpt.dpt_key ',
'    AND     dpt.dptt_key = dptt.dptt_key',
'    AND     dptt.dcp_key = dcp.dcp_key',
'    AND     rqt.res_key in (5, 6, 29, 30)',
'    AND     params.pat_key IS NOT NULL AND params.TREE_LINK_KEY IS NOT NULL ',
'    AND     req.pat_key = params.pat_key',
'    AND     (    (INSTR(params.TREE_LINK_KEY,''-'') = 0 AND params.TREE_LINK_KEY = TO_CHAR(req.req_RELEV_date,''YYYYMMDD''))',
'              OR',
'                 (INSTR(params.TREE_LINK_KEY,''-'') >0 AND req.req_key = SUBSTR(params.TREE_LINK_KEY,INSTR(params.TREE_LINK_KEY,''-'')+1) )',
'             )',
'),',
'hierarchical_rqt AS (',
'    SELECT  /*+ materialize */ rt.* , ',
'            (case ',
'                 when parent_rqt_key IS NULL then rqt_key',
'                 when parent_rqt_key IS NOT NULL THEN TO_NUMBER(parent_rqt_key||''.''||rqt_key)',
'             END) AS rt_rank',
'    FROM    request_tests rt',
'    START WITH parent_rqt_key IS NULL',
'    CONNECT BY prior req_key = req_key ',
'           --AND prior rqt_key = rqt_key',
'           AND prior rqt_key = parent_rqt_key',
'    order siblings by rqt_key DESC',
')',
'    ',
'SELECT',
'       hrqt.req_key,',
'       hrqt.req_relev_date,',
'       TO_CHAR(hrqt.req_relev_date,''DD/MM/YYYY HH24:MI'') AS REQ_RELEV_DATE_DSP,',
'       hrqt.rqt_key,',
'       hrqt.dcp_name,',
'       hrqt.dpt_name,',
'       hrqt.parent_rqt_key,',
'       hrqt.rqt_rank,',
'       (CASE ',
'           WHEN hrqt.parent_rqt_key IS NULL THEN td.td_name ',
'           ELSE ''&nbsp;''||''&nbsp;''||''&nbsp;''||''&nbsp;''||td.td_name ',
'        END',
'       )   AS td_name,       ',
'       --(SELECT TRIM(abn.abn_text_icon) FROM ilms5.abnormality@apex_link abn WHERE abn.abn_key = hrqt.abn_key)  AS ABN,',
'       (CASE',
'           -- not show abn if it is a panel ',
'           WHEN hrqt.parent_rqt_key IS NULL AND EXISTS (select 1 from request_test@apex_link rt where rt.req_key = hrqt.req_key and rt.parent_rqt_key = hrqt.rqt_key) THEN NULL',
'           ELSE  (SELECT TRIM(abn.abn_text_icon) FROM ilms5.abnormality@apex_link abn WHERE abn.abn_key = hrqt.abn_key) ',
'       ',
'        END) AS ABN,',
'       hrqt.rqt_desc AS RESULT,',
'       (SELECT ref_report FROM ilms5.reference@apex_link WHERE ref_key = hrqt.ref_key AND td_key = td.td_key) AS RANGE,',
'       (SELECT tu.tu_name FROM ilms5.test_unit@apex_link tu WHERE tu.tu_key = td.tu_key) AS UNIT,',
'       (CASE ',
'           WHEN  EXISTS (SELECT 1 FROM REQ_COM_REQ_TEST@apex_link WHERE rqt_key = hrqt.rqt_key AND req_key = hrqt.req_key) THEN ',
'                ''<a href="#"''||               ',
'                '' class="view_comments fa fa-commenting-o" data-req-key="''||hrqt.req_key||''" data-rqt-key="''||hrqt.rqt_key|| ''">''||               ',
'                ''</a>''           ',
'           ELSE NULL',
'        END)  AS COMMENTS,',
'       (CASE ',
'           WHEN hrqt.parent_rqt_key IS NULL THEN ',
'                ''<a href="#"''||               ',
'                '' class="view_cumulative fa fa-line-chart" data-req-key="''||hrqt.req_key||''" data-rqt-key="''||hrqt.rqt_key|| ''">''||               ',
'                ''</a>''           ',
'           ELSE NULL',
'        END)  AS CUMULATIVE,               ',
'       (CASE ',
'           WHEN hrqt.parent_rqt_key IS NULL AND EXISTS ( SELECT 1 FROM (SELECT SPF_REPORT FROM SPOOL_FRAME@apex_link WHERE req_key = hrqt.req_key AND SPF_IS_LAB = ''F'') WHERE SPF_REPORT IS NOT NULL) THEN ',
'                ''<a href="#"''||               ',
'                '' class="view_report fa fa-file-pdf-o" data-req-key="''||hrqt.req_key||''" data-rqt-key="''||hrqt.rqt_key|| ''">''||               ',
'                ''</a>''           ',
'           ELSE NULL',
'        END)  AS REPORT,',
'        RT_RANK',
'FROM    hierarchical_rqt hrqt,',
'        test_detail@apex_link td',
'WHERE   hrqt.td_key = td.td_key',
'ORDER BY rt_rank'))
,p_plug_source_type=>'NATIVE_IR'
,p_ajax_items_to_submit=>'P6_TREE_LINK_KEY,P6_TREE_PAT_KEY'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_prn_content_disposition=>'ATTACHMENT'
,p_prn_document_header=>'APEX'
,p_prn_units=>'INCHES'
,p_prn_paper_size=>'LETTER'
